const Quote = ({ data }) => {
  return (
    <div>
      {data.quotes.map((d) => (
        <div key={d.id}>
          <h1>{d.quote}</h1>
          <p>{d.author}</p>
        </div>
      ))}
    </div>
  );
};

export default Quote;
